import React from "react";
import "../style/RecipePage1.css";
import Header from "./Header";
// import Footer from "./Footer";

function RecipePage1() {
  return (
    <>
      <Header />
      <section id="bigcake">
        <div className="bigcake-title">
        <ul>
           <img className="soy2" src="./images/recipe/soy_no leg2.png" alt="" />
           <h1>無麩純素熱帶水果椰奶蛋糕</h1>
        </ul>
        <ul className="bigcake-main">
            <img className="cherry2" src="./images/recipe/cherry_no leg2.png" alt="" />
            <img className="main_pic" src="./images/recipe/main.png" alt="" />
        </ul>
        </div>
        <div className="process">
            <ul className="info">
                <p>材料</p>
                <p>．2顆雞蛋 (30g)
                    ．500g 奶油奶酪
．50g 代糖 (赤藻糖醇)
．50g 杏仁粉
．2根香蕉
．60g橄欖油或動物性奶油
</p>
            </ul>
            <ul className="recipe">

            </ul>
        </div>


      </section>
      {/* <Footer/> */}
    </>
  );
}
export default RecipePage1;
